import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import SignIn from './';
import SignUp from './components/SignUp/SignUp';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<SignIn/>}></Route>
          <Route path='/signUp' element={<SignUp/>}></Route>
        </Routes>
      </BrowserRouter>

    </>
  );
}

export default App;
